function maxSum(nums: number[], m: number, k: number): number {
    let maxSum = 0;
    if (k > nums.length || m > k) return 0; // Early exit if impossible conditions

    for (let i = 0; i <= nums.length - k; i++) {
        let currentSum = 0;
        const subarray = nums.slice(i, i + k);
        let freqMap = new Map<number, number>();
        for (let num of subarray) {
            currentSum += num;
            freqMap.set(num, (freqMap.get(num) || 0) + 1);
        }
        if (freqMap.size >= m) {
            maxSum = Math.max(maxSum, currentSum);
        }
    }
    return maxSum;
}
